'use strict';
let ClientMessageBuilder = require('./ClientMessageBuilder.js');
class ClientMessagesMapper {
    static mapInternalToPublic(message) {
        let result;
        if (message == null) {
            return null;
        }
        result = new ClientMessageBuilder();
        result.setMessageId(message.getMessageId());
        result.setDateTime(message.getDateTime());
        result.setFrom(message.getFrom());
        result.setMessageType(message.getMessageType());
        result.setFeature(message.getFeature());
        result.setText(message.getText());
        result.setSubject(message.getSubject());
        return result.build();
    }
}
module.exports = ClientMessagesMapper
